  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Necedah
  NWR outlines Refuge accomplishments during the 1980 calendar year. The report begins
  with an introduction to the Refuge and information about weather conditions, habitat
  conditions, and the system status. Construction, maintenance, and wildfires are
  also described. Habitat management is covered; croplands, grasslands, wetlands,
  and forests are discussed. The wildlife section of the report discusses endangered
  and threatened species, migratory birds, mammals, and non-migratory birds. Interpretation
  and recreation activities are outlined; topics include information and interpretation
  and recreation. Field investigations, cooperative programs, and safety information
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
